import React from 'react';

import { BrowserRouter, Switch, Route } from 'react-router-dom';

import Main from "./pages/main";

const Routes = () => (
    <BrowserRouter>
        <Switch>
            <Route path="/" component={Main}/>   
            <Route path="/products/:id" component={Main}/>  
        </Switch>  
    </BrowserRouter>
);
